def download_video(url, path, fmt):
    loading = tk.Label(root, text="Downloading... PLEASE WAIT")
    loading.place(x=175, y=290)
    root.update()
    try:
        yt = YouTube(url)
        title = yt.title.replace(" ", "_").replace("/", "_")

        if fmt == "MP4":
            stream = yt.streams.get_highest_resolution()
            stream.download(path, filename=f"{title}.mp4")
            loading.destroy()
            messagebox.showinfo("INFO", f"Download success: {title}.mp4")

        elif fmt == "MP3":
            stream = yt.streams.filter(only_audio=True).first()
            stream.download(path, filename=f"{title}.mp3")
            loading.destroy()
            messagebox.showinfo("INFO", f"Download success: {title}.mp3")

    except Exception as e:
        loading.destroy()
        messagebox.showerror("ERROR", str(e))


class ToggleSwitch(tk.Frame):
    def __init__(self, master, options, command=None, **kwargs):
        super().__init__(master, **kwargs)
        self.command = command
        self.options = options
        self.var = tk.StringVar(value=options[0])

        self.buttons = []
        for option in options:
            btn = tk.Button(self, text=option, relief="raised", bd=2,
                            command=lambda opt=option: self.select(opt))
            btn.pack(side="left", expand=True, fill="both")
            self.buttons.append(btn)
        self.update_buttons()

    def select(self, option):
        self.var.set(option)
        self.update_buttons()
        if self.command:
            self.command(option)

    def update_buttons(self):
        for btn in self.buttons:
            if btn.cget("text") == self.var.get():
                btn.config(relief="sunken", bg="lightgray")
            else:
                btn.config(relief="raised", bg="SystemButtonFace")

    def get(self):
        return self.var.get()


